import React from 'react';
import './index.css';


const QuestionInfo = ({counter}) => {

    return (
        <div>
        <div className="Title">Question {counter + 1} of 20</div>
        <span>Entertainment: Board Games</span>
        </div>
    );

}

export default QuestionInfo;
